import "./App.css";
import React from "react"
import Home from "./pages/Home"
import {BrowserRouter as Router, Routes, Route} from "react-router-dom"

function App() {
  
  return (
    <div className="App">
      Hello
      <Router>
        <Routes>
          <Route to='/' element = {<Home/>}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
